Array.prototype.uniq=function(){for(var t=[],i=0;i<this.length;i++){var n=this[i];(this.indexOf(n)===this.lastIndexOf(n)||-1===t.indexOf(n))&&t.push(this[i])}return t};
String.prototype.gsub=function(n,r){var e={String:function(){return new RegExp(n,"g")},RegExp:function(){return new RegExp(n.source,"g")}},t=e[n.constructor.name]();return this.replace(t,r)};
